import React from "react";
import "./login.css";

const login = () => {
  return (
    <div className="login-page">
      <div className="bg-3-1">
        <span className="login">LOGIN</span>
        <div className="form">
        <form>
        <span className="name-password-phone">NAME</span>
        <input type="text" className="name"></input><br></br>
        <span className="name-password-phone">PASSWORD</span>
        <input type="text" className="name"></input><br></br>
        <span className="name-password-phone">PHONE NO</span>
        <input type="text" className="name"></input><br></br>
        </form>
        </div>
        <a><Link to="./Home"><div className="button"><button className="rectangle-7">SIGN IN</button></div></Link></a>
        <div className="flex-container">
        <div><button className="rectangle-8">Create an account!</button></div>
        <div><button className="rectangle-9">Forgot password?</button></div>
        </div>
      </div>
    </div>
  );
};
export default login;
